import React from "react";
import "./Quote.css";

function Quote(props) {
  let imageNumber = Math.floor(Math.random() * 3 + 1);
  return (
    <div class="mb-wrap mb-style-3">
      
      <blockquote>
        <p>{props.text}</p>
      </blockquote>
      <div class="mb-attribution">
      
        <p class="mb-author">Руденко Кристина</p>
      </div>
    </div>
  );
}

export default Quote;
